/* NAVBAR - INDEX.JS */

import React from 'react';

import './style.css';

export default function NavBar() {
    return (
        <div className="navbar">
            
            <NavLink className="active" to="upload" pill>
                Upload
            </NavLink>
    
            <NavLink to="files" pill>
                Files
            </NavLink>
         
        </div>
    )
}
